import { useState, useReducer, createContext, useContext } from 'react';

function MyButton({idButton, classButton} : {idButton: string, classButton: string}) {
    return (
        <button id={idButton} className={classButton}>Click me</button>
    );
}

export default function MyApp() {
    return (
        <div>
            <MyButton idButton="component-B__button" classButton="button" />

        </div>
    );
}
